Team Spam - Plus (12008 HE)

Hello, Earth.

You are receiving a transmission from Team Spam.

As we are well-known space-travelers, you undoubtedly are familiar with our previous musical exploits.

In 12008 HE, the current year, Team Spam has compiled together an album that is at once the most incredible thing that has ever existed, as well as being the greatest thing ever. Truly a fantastic feat.

This upload is being performed by B2LD Records, a section of B2LD Enterprises. It is our stance that no one associated with B2LD will ever require payment for music.

We appreciate your support.

